tuesday i head out to cover my 3rd world championship out in budapest.

couple of things i learned a long the way:
 - pace yourself
 - embrace the culture
 - hydrate
 - respect the older people who’ve been here before you 
 - prioritize and make time for yourself burn out is real and honestly unnecessary 
 - work together and have fun it it’s never that serious.
 - focus on the relationships and people you meet the next few weeks, i’ve honestly met some life long friends on these trips and those are the things that matter most than getting the perfect photo.

