homecoming.

things didn't go as planned.i came into the race a little beat up and not fully recovered from Berlin. yesterday was painful, never had to deal with knee pain while running. 
this was my 3rd @nycmarathon and i don’t remember ever being it this hard. 

thankfully i met this woman named iman. we stuck by each other all the way till the end of LIC. we were kicking it, sharing stories getting to know each other sharing snacks like grapes, we even split a bagel at one point. 

moments like yesterday remind me how special this city is. for 364 days we new yorkers ignore each other and go on with our lives just worrying about ourselves. 

but every first Sunday of Nov the city feels like a tribe, all helping each other and cheering on strangers to help them get to the finish line. a piece of my soul was left on 1st ave. the amount of support and positive talk from strangers helped me get to that finish line. marathon Sunday reminds me why this is my favorite weekend of the year and why I love this city so much.

congrats to all the runners ❤️

